import {
  CalendarOutlined,
  // CrownOutlined,
  ClusterOutlined,
  // FrownOutlined,
  HeartOutlined,
  HomeOutlined,
  IdcardOutlined,
  StarOutlined,
  // CloudUploadOutlined,
  // UploadOutlined,
  UserOutlined
} from '@ant-design/icons';
import { APP_PREFIX_PATH } from 'configs/AppConfig'

const dashBoardNavTree = [
  {
    key: 'home',
    path: `${APP_PREFIX_PATH}/journeys/journey-ivr/home`,
    title: 'home',
    icon: HomeOutlined,
    breadcrumb: false,
    submenu: []
  },
  {
    key: 'dashboard',
    path: `${APP_PREFIX_PATH}/journeys/journey-ivr/dashboard`,
    title: 'Dashboard',
    icon: HeartOutlined,
    breadcrumb: false,
    submenu: []
  },
  {
    key: 'transaction',
    path: `${APP_PREFIX_PATH}/journeys/journey-ivr/transaction`,
    title: 'Transaction',
    icon: StarOutlined,
    breadcrumb: false,
    submenu: []
  },
  {
    key: 'dailyTracker',
    path: `${APP_PREFIX_PATH}/journeys/journey-ivr/dailyTracker`,
    title: 'Daily Tracker',
    icon: CalendarOutlined,
    breadcrumb: false,
    submenu: []
  },
  {
    key: 'taskTracker',
    path: `${APP_PREFIX_PATH}/journeys/journey-ivr/taskTracker`,
    title: 'Task Tracker',
    icon: ClusterOutlined,
    breadcrumb: false,
    submenu: []
  },
  {
    key: 'userRoles',
    path: `${APP_PREFIX_PATH}/journeys/journey-ivr/userRoles`,
    title: 'Users & Roles',
    icon: IdcardOutlined,
    breadcrumb: false,
    submenu: []
  },
  {
    key: 'dialogFlow',
    path: `${APP_PREFIX_PATH}/journeys/journey-ivr/dialogFlow`,
    title: 'Personalize Your Journey',
    icon: ClusterOutlined,
    breadcrumb: false,
    submenu: []
  },
  {
    key: 'agentInfo',
    path: `${APP_PREFIX_PATH}/journeys/journey-ivr/agentInfo`,
    title: 'Agent Task Info',
    icon: UserOutlined,
    breadcrumb: false,
    submenu: []
  }
]

const navigationConfig = [
  ...dashBoardNavTree
]

export default navigationConfig;
